import Form from "./Form";
import Invoice from "./Invoice";
import { BrowserRouter, Route, Routes } from 'react-router-dom';


function App() {
  return (
    <div>
      <BrowserRouter>
        <div className="App">
          <Form/>
          <Invoice/>
          <Routes>
            <Route path="/" exact component={Form} />
            <Route path="/invoice" exact component={Invoice} />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
